    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE + col2 + + col1 NOT IN ( 85 + + + 80, CAST ( + col1 AS REAL ) );
  - name: tab1

outputs:
  - name: q8746.out
    data: |
      51	14	96
      85	5	59
      91	47	68
